import React, { useState } from 'react';

function List({ newPost }) {
  return (
    <div>
      <h2>게시글</h2>
      {newPost ? (
        <ul>
          <li>
            <strong>제목:</strong> {newPost.title}, <strong>글쓴이:</strong> {newPost.who}
          </li>
        </ul>
      ) : (
        <div>게시글이 없습니다.</div>
      )}
    </div>
  );
}

export default List;
